import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Navbar from "./Components/Navbar";
import Section from "./Components/Section";
import dummyText from "./DummyText";
const App = () => {
    return (
      <div className="App">
        <Navbar />
        <Section
          title="Services"
          subtitle={dummyText}
          dark={true}
          id=""
        />
        <Section
          title="About"
          subtitle={dummyText}
          dark={false}
          id="section2"
        />
        <Section
          title="Philantrophy"
          subtitle={dummyText}
          dark={true}
          id="section3"
        />
      </div>
    );
}

export default App;
